package print_java;

public class Boolean {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int size=55;
		String color="red";
		
		boolean lc= size>=50 && color=="red";
		
		if(lc)
		{
			System.out.println("lc"+lc);
		}
		
		else
		{
			System.out.println("FALSE");
		}
	}
	
}
